document.addEventListener('DOMContentLoaded', () => {
  verificarSesion();
});

function verificarSesion() {
  if (!sessionStorage.getItem('usuario')) {
    window.location.href = './login.html';
  } else {
    inicializarEventos();
    mostrarSalones();
  }
}

function inicializarEventos() {
  document.getElementById('logout')?.addEventListener('click', cerrarSesion);

  document.getElementById('formSalon')?.addEventListener('submit', function (event) {
    event.preventDefault();
    const salon = obtenerDatosFormulario();
    guardarSalon(salon);
    this.reset();
    mostrarSalones();
  });

  document.getElementById('btnCancelar')?.addEventListener('click', function () {
    document.getElementById('titulo').value = '';
    document.getElementById('descripcion').value = '';
    document.getElementById('imagen').value = '';
    document.getElementById('btnModificarSalon').style.visibility = 'hidden';
    document.getElementById('btnAgregarSalon').style.visibility = 'visible';
  });
}

function cerrarSesion() {
  sessionStorage.clear();
  window.location.href = './login.html';
}

function obtenerDatosFormulario() {
  const salones = JSON.parse(localStorage.getItem('salones')) || [];
  const imagenes = JSON.parse(localStorage.getItem('imagenes')) || [];

  const ultimoIdSalon = salones.length > 0 ? salones[salones.length - 1].id : 0;
  const nuevoIdSalon = ultimoIdSalon + 1;

  const rutaImagen = document.getElementById('imagen')?.value || '';
  const idImagen = imagenes.length > 0 ? imagenes[imagenes.length - 1].id + 1 : 1;

  if (rutaImagen) {
    const nuevaImagen = {
      id: idImagen,
      idSalon: nuevoIdSalon,
      ruta: rutaImagen
    };
    imagenes.push(nuevaImagen);
    localStorage.setItem('imagenes', JSON.stringify(imagenes));
  }

  return {
    id: nuevoIdSalon,
    titulo: document.getElementById('titulo')?.value || '',
    descripcion: document.getElementById('descripcion')?.value || ''
  };
}

function guardarSalon(salon) {
  const salones = JSON.parse(localStorage.getItem('salones')) || [];
  salones.push(salon);
  localStorage.setItem('salones', JSON.stringify(salones));
}

function mostrarSalones() {
  let salones = JSON.parse(localStorage.getItem('salones'));
  let imagenes = JSON.parse(localStorage.getItem('imagenes'));

  if (!salones || salones.length === 0) {
    salones = [
      { id: 1, titulo: 'Salón Fiesta 1', descripcion: 'Decorado con luces y globos' },
      { id: 2, titulo: 'Salón Aventura', descripcion: 'Temática exploradores' },
      { id: 3, titulo: 'Salón Encanto', descripcion: 'Estilo mágico y colorido' },
      { id: 4, titulo: 'Salón Retro', descripcion: 'Decoración vintage y neón' }
    ];

    imagenes = [
      {
        id: 1,
        idSalon: 1,
        ruta: "data:image/jpeg;base64,"
      },
      {
        id: 2,
        idSalon: 2,
        ruta: "data:image/jpeg;base64,"
      },
      {
        id: 3,
        idSalon: 3,
        ruta: "data:image/jpeg;base64,"
      },
      {
        id: 4,
        idSalon: 4,
        ruta: "data:image/jpeg;base64,"
      }
    ];

    localStorage.setItem("salones", JSON.stringify(salones));
    localStorage.setItem("imagenes", JSON.stringify(imagenes));
  }

  const tablaBody = document.querySelector('#tablaSalones tbody');
  if (!tablaBody) return;

  tablaBody.innerHTML = '';

  salones.forEach((salon, index) => {
    const imagenAsociada = imagenes.find(img => img.idSalon === salon.id);
    const rutaImg = imagenAsociada ? imagenAsociada.ruta : '';

    const fila = document.createElement('tr');
    fila.innerHTML = `
      <td>${salon.titulo}</td>
      <td>${salon.descripcion}</td>
      <td>
        ${rutaImg ? `<img src="${rutaImg}" class="img-fluid" style="max-height: 100px;" />` : 'Sin imagen'}
      </td>
      <td>
        <button type="button" class="btn btn-warning" onClick="eventoModificar('${salon.titulo}','${salon.descripcion}','${rutaImg}','${index}')">Modificar</button>
        <button type="button" class="btn btn-danger" onClick="eventoEliminar('${index}')">Eliminar</button>
      </td>
    `;
    tablaBody.appendChild(fila);
  });
}
window.mostrarSalones = mostrarSalones;